import { motion } from "framer-motion"
import "../App.css"
const containter= {
    oculto: {opacity : 0},
    mostrar:{
        opacity: 1,
        transition:{
            delayChildren: 0.5
        }
    }
}
const item={
oculto:{opacity:0},
mostrar:{opacity:5}

}
function Projects (){
    return (
        <div className="containter">
            <motion.ul className="box"
            variants={containter}
            initial="oculto"
            animate="mostrar"
            >
            <motion.li variants={item}/>
            <motion.li variants={item}/>
            <motion.li variants={item}/>
            <motion.li variants={item}/>

            </motion.ul>
        </div>
      
);
}
export default Projects;
